import React from 'react';
import {useNavigate} from 'react-router-dom';


function Home() {
    
    const navigate = useNavigate();

    
    return (
        <body>
            <div id="navbar_home">
                <ul>
                    <a href="/about">How it works</a>
                    <a href="/about">What we do</a>
                    <a href="/about">Contact us</a>
                </ul>
            </div>
        </body>
    )
}

export default Home
